window.bookSummaryJSON = "<p><b>Well, it could be better. </b></p> <p>Jim and his literal shoulder demon have survived, so far, by the skin of their teeth.&nbsp;</p> <p>After finding a long-abandoned starter village, Jim has begun the process of rebuilding his town. Unfortunately for our favorite adventurer, the threats he now faces are far more complicated than mere monsters. The poor Noob has to deal with angry townsfolk, trade negotiations, and a talking badger.&nbsp;</p> <p>With goblins and bandits also sniffing around, will Noobtown - I mean Windfall - survive?</p>"; 
